import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Make sure to import these from react-router-dom
import LoginPage from '../pages/LoginPage';
import AdminDashboard from '../pages/Admin/AdminDashboard';
import RegisterAdmin from '../pages/Admin/RegisterAdmin';
import AddTeacher from '../pages/Admin/AddTeacher';
import AddCounselor from '../pages/Admin/AddCounselor';
import History from '../pages/Admin/History';
import TeacherDashboard from '../pages/Teacher/TeacherDashboard';
import CounselorDashboard from '../pages/Counselor/CounselorDashboard';
import ProtectedRoute from './ProtectedRoute'; // Import ProtectedRoute component

function App() {
  return (
    <Router>
      <Routes>
        {/* Public Routes */}
        <Route path="/login" element={<LoginPage />} />
        <Route path="/register" element={<RegisterAdmin />} />

        {/* Protected Routes */}
        <Route path="/admin-dashboard" element={<ProtectedRoute><AdminDashboard /></ProtectedRoute>} />
        <Route path="/add-teacher" element={<ProtectedRoute><AddTeacher /></ProtectedRoute>} />
        <Route path="/add-counselor" element={<ProtectedRoute><AddCounselor /></ProtectedRoute>} />
        <Route path="/history" element={<ProtectedRoute><History /></ProtectedRoute>} />

        <Route path="/teacher-dashboard" element={<ProtectedRoute><TeacherDashboard /></ProtectedRoute>} />
        <Route path="/counselor-dashboard" element={<ProtectedRoute><CounselorDashboard /></ProtectedRoute>} />
      </Routes>
    </Router>
  );
}

export default App;
